const items = $input.all(); // Pega todos os itens da entrada

// Mapeia os domínios para o formato esperado
const urlsList = items.map(item => ({ url: item.json.dominio_scraping }));

// Função para dividir em blocos de 150
function chunkArray(array, chunkSize) {
  const result = [];
  for (let i = 0; i < array.length; i += chunkSize) {
    result.push(array.slice(i, i + chunkSize));
  }
  return result;
}

// Divide os links em blocos de até 150
const chunkedUrls = chunkArray(urlsList, 150);

// Retorna um array de itens, cada um com até 150 links
return chunkedUrls.map(chunk => ({
  json: {
    startUrls: chunk
  }
}));

// Itera sobre todos os itens de entrada
const items = $input.all();

const outputs = [];

for (const item of items) {
  const failedItem = item.json;
  const urlToRetry = failedItem.initialUrl;

  // Verifica se a URL existe
  if (!urlToRetry) {
    console.warn("Item sem initialUrl chegou para retry (Datacenter):", failedItem);
    continue; // Pula para o próximo item
  }

  // Monta o objeto de entrada para o ator Apify Playwright
  const apifyInput = {
    startUrls: [{ url: urlToRetry }],
    proxyConfiguration: {
      useApifyProxy: true,
      apifyProxyGroups: ["DATACENTER"]
    }
  };

  // Adiciona o resultado à lista de saída
  outputs.push({ json: apifyInput });
}

// Retorna todos os objetos formatados
return outputs;

const items = $input.all();

// Usa o campo 'initialUrl' ao invés de 'WebsiteURL'
const startUrls = items
  .map(item => item.json.initialUrl)
  .filter(url => !!url) // Garante que não seja null ou undefined
  .map(url => ({ url }));

const output = {
  startUrls,
  proxyConfig: {
    useApifyProxy: true,
    apifyProxyGroups: ["RESIDENTIAL"],
    apifyProxyCountry: "BR"
  }
};

return [{ json: output }];

/**
 * Extrai o nome antes do TLD a partir de processedUrl OU websiteDomain.
 * Gera:
 * - domainName
 * - titleName
 * - socialName
 * E, se houver endereço:
 * - combinações de cada um acima + endereço
 */

function cleanTitle(title) {
  if (!title) return '';
  title = title.replace(/([a-z])([A-Z])/g,'$1 $2');
  const bad = ['tabela','preços','lojas','botão','whatsapp','home','início'];
  if (bad.some(w=>new RegExp(`\\b${w}\\b`,'i').test(title))) return '';
  title = title.split(/[\|\–\-»>]/)[0].trim().replace(/\s+/g,' ');
  return title.length >= 3 ? title : '';
}

function extractDomainName(url, fallbackDomain) {
  let host = '';
  try {
    host = new URL(url).hostname;
  } catch {
    host = fallbackDomain || '';
  }
  host = host.replace(/^www\./,'')
             .replace(/\.com\.br$|\.com$|\.br$|\.net$|\.org$/i,'');
  if (!host) return '';
  return host
    .split(/[\.-]/)
    .map(w=>w.charAt(0).toUpperCase() + w.slice(1))
    .join(' ');
}

function extractSocialName(links = []) {
  for (const l of links) {
    const m = l.match(/(?:instagram\.com|facebook\.com)\/([A-Za-z0-9._-]+)/i);
    if (m) {
      return m[1]
        .replace(/[._]/g,' ')
        .split(' ')
        .map(w=>w.charAt(0).toUpperCase() + w.slice(1))
        .join(' ');
    }
  }
  return '';
}

function getAddress(addrs = []) {
  return (addrs[0] || '').trim().replace(/\s+/g,' ');
}

const output = [];

for (const { json } of $input.all()) {
  // tenta processedUrl, senão websiteDomain
  const rawUrl     = json.processedUrl || `https://${json.websiteDomain}`;
  const domainName = extractDomainName(rawUrl, json.websiteDomain);
  const titleName  = cleanTitle(json.pageTitle);
  const socialName = extractSocialName(json.extractedSocialLinks);
  const address    = getAddress(json.extractedAddresses);

  const itemQs = new Set();

  // 1) Sempre inclua o domínio
  if (domainName) itemQs.add(domainName);
  // 2) Título limpo
  if (titleName) itemQs.add(titleName);
  // 3) Social ID
  if (socialName) itemQs.add(socialName);

  // 4) Combinações com endereço
  if (address) {
    if (domainName) itemQs.add(`${domainName} ${address}`);
    if (titleName)  itemQs.add(`${titleName} ${address}`);
    if (socialName) itemQs.add(`${socialName} ${address}`);
  }

  // Empacota como [{ json: { query } }, …]
  for (const q of itemQs) {
    output.push({ json: { query: q.trim() } });
  }
}

// Retorna no máximo 60 queries
return output.slice(0, 60);

// Expressões regulares
// Telefones BR: opcional “+” e country code 55, DDD 11–99, número 8 dígitos (landline) ou 9 dígitos começando em 9 (mobile)
const phoneRegex = /^(\+?55)?[1-9][0-9](?:[2-8]\d{7}|9\d{8})$/;

// E-mail básico
const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

// Percorre todos os items
return items.map(item => {
  const jsonIn = item.json;

  // 1) Telefones: filtra apenas os que passam no regex
  const phones = Array.isArray(jsonIn.cleanedPhones)
    ? jsonIn.cleanedPhones.filter(p => phoneRegex.test(p))
    : [];

  // 2) E-mails: filtra sintaxe e exclui genericões Sentry/hex
  const emails = Array.isArray(jsonIn.extractedEmails)
    ? jsonIn.extractedEmails.filter(email => {
        if (!emailRegex.test(email)) return false;
        const [local, domain] = email.split('@');
        // remove domínios que contenham "sentry"
        if (domain.toLowerCase().includes('sentry')) return false;
        // remove local parts que são longos hashes hexadecimais (>10 chars)
        if (/^[a-f0-9]{10,}$/i.test(local)) return false;
        return true;
      })
    : [];

  // Retorna o item original + campos validados
  return {
    json: {
      ...jsonIn,
      validatedPhones: phones,
      validatedEmails: emails
    }
  };
});

const items = $input.all();
let output = [];

function normalizar(numStr) {
  const sóDigitos = String(numStr).replace(/\D/g, '');
  let n = sóDigitos;
  if (n.startsWith('550')) n = '55' + n.slice(3);
  if ((n.length === 10 || n.length === 11) && !n.startsWith('55')) {
    n = '55' + n;
  }
  if (n.startsWith('55') && (n.length === 12 || n.length === 13)) {
    const ddd = parseInt(n.slice(2, 4), 10);
    const resto = n.slice(4);
    if (
      ddd >= 11 && ddd <= 99 &&
      (resto.length === 8 || (resto.length === 9 && resto.startsWith('9')))
    ) {
      return n;
    }
  }
  return null;
}

for (const item of items) {
  const telefonesScraping = item.json.telefones_scraping || "";
  const gmnTelefone = item.json.gmn_telefone || "";
  let todosOsNumeros = [];

  if (telefonesScraping) {
    try {
      todosOsNumeros = todosOsNumeros.concat(JSON.parse(telefonesScraping));
    } catch (e) {
      todosOsNumeros = todosOsNumeros.concat(
        telefonesScraping
          .split(',')
          .map(s => s.replace(/[\[\]"]+/g, '').trim())
          .filter(Boolean)
      );
    }
  }

  if (gmnTelefone) {
    todosOsNumeros.push(gmnTelefone);
  }

  const numerosParaVerificar = Array.from(new Set(
    todosOsNumeros
      .map(normalizar)
      .filter(n => n !== null)
  )).slice(0, 10); // Limita aos primeiros 10 números válidos e únicos

  const resultados = numerosParaVerificar.flatMap(numero => {
    const ddd = numero.slice(2, 4);
    const resto = numero.slice(4);

    const numeroCom9 = resto.length === 9
      ? numero
      : `55${ddd}9${resto}`;
    const numeroSem9 = resto.length === 9 && resto.startsWith('9')
      ? `55${ddd}${resto.slice(1)}`
      : `55${ddd}${resto}`;

    return [
      {
        json: {
          id:                  item.json.id,
          telefones_scraping:  item.json.telefones_scraping,
          gmn_telefone:        item.json.gmn_telefone,
          empresa_id_original: item.json.id,
          numero_para_verificar: numeroCom9
        }
      },
      {
        json: {
          id:                  item.json.id,
          telefones_scraping:  item.json.telefones_scraping,
          gmn_telefone:        item.json.gmn_telefone,
          empresa_id_original: item.json.id,
          numero_para_verificar: numeroSem9
        }
      }
    ];
  });

  output.push(...resultados);
}

return output;

const results = [];

for (const item of items) {
  const input = item.json;
  const idEmpresa = $('id_empresa').first().json.id; // id vindo do nó anterior

  if (input.success === true) {
    results.push({
      json: {
        ...input,
        contato_whatsapp_validado_info: {
          ...input.data,
          id: idEmpresa
        }
      }
    });
  } else {
    // Se quiser manter os outros casos
    results.push({
      json: {
        ...input,
        id: idEmpresa
      }
    });
  }
}

return results;

const contatosMap = new Map();

for (const item of items) {
  const contatos = item.json.contato_whatsapp_validado_info;

  for (const contato of contatos) {
    // Definir um identificador único confiável
    const key = contato.jid || contato.wid || contato.number;

    if (!key) continue; // pula se não houver identificador

    // Normaliza o campo website como array
    const websites = Array.isArray(contato.website)
      ? contato.website
      : contato.website
        ? [contato.website]
        : [];

    if (!contatosMap.has(key)) {
      contatosMap.set(key, {
        id: contato.id,
        isBusiness: contato.isBusiness,
        jid: contato.jid || contato.wid,
        number: contato.number || contato.wid,
        message: contato.message || null,
        description: contato.description || null,
        website: websites.slice(),
        category: contato.category || null,
      });
    } else {
      // Atualiza caso já exista (ex: mesclar múltiplos websites)
      const existing = contatosMap.get(key);
      existing.website = Array.from(new Set([
        ...existing.website,
        ...websites
      ]));
      contatosMap.set(key, existing);
    }
  }
}

// Formata saída
const results = Array.from(contatosMap.values()).map(c => ({
  json: {
    ...c,
    website: c.website.join(', ')
  }
}));

return results;

return items.flatMap(item => {
  const id = item.json.id;
  const emailsJson = item.json.emails_scraping;
  let emails = [];

  try {
    emails = JSON.parse(emailsJson);
  } catch (err) {
    return []; // pular se o parse falhar
  }

  // Remover duplicatas
  const uniqueEmails = [...new Set(emails)];

  return uniqueEmails.map(email => ({
    json: {
      empresa_id: id,
      email: email
    }
  }));
});

