return items.map(item => {
  let raw = item.json.website?.trim() || '';

  // Remove espaços e barras erradas no início
  raw = raw.replace(/^\/+/, '').replace(/\s+/g, '');

  // Adiciona https se não tiver http/https
  if (!/^https?:\/\//i.test(raw)) {
    raw = 'https://' + raw;
  }

  // Tratamento adicional: remove múltiplas barras após o domínio
  raw = raw.replace(/([^:])\/{2,}/g, '$1/');

  // Expressão para testar se é uma URL básica com domínio e TLD
  const domainRegex = /^https?:\/\/([a-z0-9-]+\.)+[a-z]{2,}(\/.*)?$/i;

  const isValid = domainRegex.test(raw);

  // Atualiza os campos com os novos dados
  item.json.website = raw;
  item.json.InvalidURL = !isValid;

  return item;
});

