function chunkArray(array, chunkSize) {
  const result = [];
  for (let i = 0; i < array.length; i += chunkSize) {
    result.push(array.slice(i, i + chunkSize));
  }
  return result;
}

// Divide os itens em blocos de 30
const chunkedItems = chunkArray(items, 30);

// Cada grupo retorna os objetos no mesmo formato que entraram
return chunkedItems.map(group => ({
  json: {
    items: group.map(item => item.json)
  }
}));

// Supondo que cada item() tem a forma: { items: [ ... ] }
// Vamos extrair todos os itens de cada item da entrada.

let results = [];

for (const item of items) {
  const unpacked = item.json.items;
  for (const single of unpacked) {
    results.push({ json: single });
  }
}

return results;

// Compactar objetos em blocos de 20

const tamanhoBloco = 20;
const dados = items.map(item => item.json); // pega todos os objetos

const blocos = [];

for (let i = 0; i < dados.length; i += tamanhoBloco) {
  const bloco = dados.slice(i, i + tamanhoBloco);
  const jsonString = JSON.stringify(bloco);
  blocos.push({ json: { blocoCompactado: jsonString } });
}

return blocos;

// Descompactar os blocos de string JSON

const resultado = [];

for (const item of items) {
  const bloco = JSON.parse(item.json.blocoCompactado); // transforma string em array
  for (const obj of bloco) {
    resultado.push({ json: obj });
  }
}

return resultado;
